// import logo from './logo.svg';
import './App.css';
import Navbar from './Navbar'
import home from './home'
import game from './game'
import credits from './pages/credits'

function App() {
  let Component
  switch (window.location.pathname) {
    case '/':
      Component = home;
      break
      case "/game":
        Component = game;
        break
        case "/credits":
          Component = credits;
          break
  }
  return (
    <Navbar></Navbar>
  )
}

export default App;
